import React from 'react'
import styled from 'styled-components'

const SearchWrapper = styled.div`
  position: relative;
`

const SearchIcon = styled.div`
  position: absolute;
  top: 10;
  left: 0;
`

const Search = styled.input`
  border-radius: 200px;
  background-color: #f5efe5;
  border: none;
  width: 300px;
  padding: 10px 30px;
  margin: 8px;

  &:focus {
    border: none;
  }

  &::placeholder {
    content: 'Search...';
    color: gray;
  }
`

const SearchInput = () => {
  return (
    <SearchWrapper>
      <div>
        {' '}
        <SearchIcon>
          <svg width='20' height='20' viewBox='0 0 20 20' fill='none' xmlns='http://www.w3.org/2000/svg'>
            <path
              d='M8.75002 15.8334C12.662 15.8334 15.8334 12.662 15.8334 8.75002C15.8334 4.83802 12.662 1.66669 8.75002 1.66669C4.83802 1.66669 1.66669 4.83802 1.66669 8.75002C1.66669 12.662 4.83802 15.8334 8.75002 15.8334Z'
              fill='#2F88FF'
              stroke='black'
              stroke-width='1.66667'
              stroke-linejoin='round'
            />
            <path
              d='M11.1071 5.97629C10.5039 5.37308 9.67057 5 8.75007 5C7.82961 5 6.99627 5.37308 6.39307 5.97629'
              stroke='white'
              stroke-width='1.66667'
              stroke-linecap='round'
              stroke-linejoin='round'
            />
            <path
              d='M13.8423 13.8424L17.3779 17.3779'
              stroke='black'
              stroke-width='1.66667'
              stroke-linecap='round'
              stroke-linejoin='round'
            />
          </svg>
        </SearchIcon>
        <Search type='search' className='rounded-search-input' />
      </div>
    </SearchWrapper>
  )
}

export default SearchInput
